// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

/*
    Project: Document Verification using Blockchain Technology
    Description:
    - Stores document hash on blockchain
    - Verifies document authenticity using hash comparison
*/

contract DocumentVerification {

    // Structure to store document details
    struct Document {
        address uploader;
        uint256 timestamp;
        bool exists;
    }

    // Mapping: document hash => Document details
    mapping(bytes32 => Document) private documents;

    // Event emitted when document is stored
    event DocumentStored(
        bytes32 indexed documentHash,
        address indexed uploader,
        uint256 timestamp
    );

    // ðŸ”¹ Store document hash on blockchain
    function storeDocumentHash(bytes32 _documentHash) public {
        require(!documents[_documentHash].exists, "Document already exists");

        documents[_documentHash] = Document({
            uploader: msg.sender,
            timestamp: block.timestamp,
            exists: true
        });

        emit DocumentStored(_documentHash, msg.sender, block.timestamp);
    }

    // ðŸ”¹ Verify if document hash exists
    function verifyDocument(bytes32 _documentHash)
        public
        view
        returns (bool isVerified, address uploader, uint256 timestamp)
    {
        if (documents[_documentHash].exists) {
            Document memory doc = documents[_documentHash];
            return (true, doc.uploader, doc.timestamp);
        } else {
            return (false, address(0), 0);
        }
    }
}

